    import "@openzeppelin/contracts/access/Ownable.sol";
    import "@openzeppelin/contracts/utils/math/SafeMath.sol";

    contract NFT is ERC721, Ownable {
        using SafeMath for uint256;
        using Strings for uint256;
        uint256 private _currentTokenId = 0;
        uint256 private _limitTokenCount = 999;
        
        // Optional mapping for token URIs
        mapping (uint256 => string) private _tokenURIs;

        // Base URI
        string private _baseURIextended;


        constructor(string memory _name, string memory _symbol)
            ERC721(_name, _symbol)
        {
            // string memory tokenURI = "https://ipfs.io/ipfs/bafybeidup2l6yqplc5whof7lu27oprggrkpvh6fwqastrfwymcp3bsgley/metadata.json";
            // for (uint256 i = 1; i < 1000; i++) {
            //     uint256 newTokenId = _getNextTokenId();
            //     require(newTokenId <= _limitTokenCount, "Token is full to 999");
            //     _safeMint(address(0xe59ec378c5bd6e2CBEBCabF8F23fC323bFcD63C2), newTokenId);
            //     //_setTokenURI(newTokenId, tokenURI);
            //     _incrementTokenId();
            // }
        }

        /**
         * @dev calculates the next token ID based on value of _currentTokenId
         * @return uint256 for the next token ID
         */
        function _getNextTokenId() private view returns (uint256) {
            return _currentTokenId.add(1);
        }

        /**
         * @dev increments the value of _currentTokenId
         */
        function _incrementTokenId() private {
            _currentTokenId++;
        }
        
        function setBaseURI(string memory baseURI_) external onlyOwner() {
            _baseURIextended = baseURI_;
        }
        
        function _setTokenURI(uint256 tokenId, string memory _tokenURI) internal virtual {
            require(_exists(tokenId), "ERC721Metadata: URI set of nonexistent token");
            _tokenURIs[tokenId] = _tokenURI;
        }
        
        function setTokenURI(uint256 tokenId, string memory _tokenURI) public virtual {
            require(_exists(tokenId), "ERC721Metadata: URI set of nonexistent token");
            _tokenURIs[tokenId] = _tokenURI;
        }
        
        function setMultiTokenURIs(uint256 [] memory tokenIds, string [] memory _tokenURIs) external onlyOwner() {
            uint256 length = tokenIds.length;
            for (uint256 i = 0; i < length; i++) {
                setTokenURI(tokenIds[i], _tokenURIs[i]);
            }
        }
        
        function mintMultiNFT(address _to, uint256 amount) external onlyOwner() {
            for (uint256 i = 1; i <= amount; i++) {
                uint256 newTokenId = _getNextTokenId();
                require(newTokenId <= _limitTokenCount, "Token is full to 999");
                _safeMint(_to, newTokenId);
                //_setTokenURI(newTokenId, tokenURI_);
                _incrementTokenId();
            }
        }
        
        // function mintNFT(address _to, string memory tokenURI_) public payable {
            
        //     for (uint i = 0; i < 999; i++) {
        //         uint mintIndex = totalSupply();
        //         if (block.timestamp < REVEAL_TIMESTAMP) {
        //             _mintedBeforeReveal[mintIndex] = true;
        //         }
        //         _safeMint(msg.sender, mintIndex);
        //     }
    
        //     /**
        //     * Source of randomness. Theoretical miner withhold manipulation possible but should be sufficient in a pragmatic sense
        //     */
        //     if (startingIndexBlock == 0 && (totalSupply() == MAX_NFT_SUPPLY || block.timestamp >= REVEAL_TIMESTAMP)) {
        //         startingIndexBlock = block.number;
        //     }
        // }

        function _baseURI() internal view virtual override returns (string memory) {
            return "https://opensea-creatures-api.herokuapp.com/api/creature/";
        }
        
        function tokenURI(uint256 tokenId) public view virtual override returns (string memory) {
            require(_exists(tokenId), "ERC721Metadata: URI query for nonexistent token");

            string memory _tokenURI = _tokenURIs[tokenId];
            string memory base = _baseURI();
            return _tokenURI;
            
            // If there is no base URI, return the token URI.
            if (bytes(base).length == 0) {
                return _tokenURI;
            }
            // If both are set, concatenate the baseURI and tokenURI (via abi.encodePacked).
            if (bytes(_tokenURI).length > 0) {
                return string(abi.encodePacked(base, _tokenURI));
            }
            // If there is a baseURI but no tokenURI, concatenate the tokenID to the baseURI.
            return string(abi.encodePacked(base, tokenId.toString()));
        }
        
        function mint(
            address _to,
            string memory tokenURI_
        ) public {
            uint256 newTokenId = _getNextTokenId();
            require(newTokenId <= _limitTokenCount, "Token is full to 999");
            _mint(_to, newTokenId);
            _setTokenURI(newTokenId, tokenURI_);
            _incrementTokenId();
        }
    }
